# %% TODO: [00] INTRODUCTION
# Se desarrolla abaco presentado en "THEORETICAL STRESS-STRAIN MODEL FOR CON-
# FINED CONCRETE", By J. B. Mander, M. J. N. Priestley, and R. Park, 1988.

# To determine the confined concrete compressive strength f'cc, a constitutive 
# model involving a specified ultimate strength surface for multiaxial compre-
# ssive stresses is used in this model. The "five-parameter" multiaxial failure 
# surface described by William and Warnke (1975) is adopted, since it provides 
# excellent agreement with triaxial test data. The calculated ultimate strength 
# surface based on the triaxial tests of Schickert and Winkler (1977) is adopted 
# here. Details of the calculations have been given by Elwi and Murray (1979).

# Elwi, A. A., and Murray, D. W. (1979). "A 3D hypoelastic concrete constitutive 
# relationship."
# William, K. J., and Warnke, E. P. (1975). "Constitutive model for the triaxial 
# behavior of concrete."
# Schickert, G., and Winkler, H. (1979). "Results of tests concerning strength 
# and strain of concrete subjected to multiaxial compressive stresses." 

# NOTA: FORMATO DE DEFINICION DE VARIABLES.
# Name    = XXX              [Name (10 * " ") + "=" + " " + Value]              # Comentario.


# %% TODO: [01] LIBRARIES
import numpy as np
from scipy.optimize import fsolve
import matplotlib.pyplot as plt
from matplotlib.font_manager import FontProperties


# %% TODO: [02] FUNCTION
# Functions to calculate parameter of the model.
def sigma_a(fcc,fl2,fl3):
    fcc = fcc
    fl2 = fl2
    fl3 = fl3
    return (fcc+fl2+fl3)/3


def tau_a(fcc,fl2,fl3):
    fcc = fcc
    fl2 = fl2
    fl3 = fl3
    return ((1)/((15)**0.5))*((fcc-fl2)**(2)+(fl2-fl3)**(2)+(fl3-fcc)**(2))**(((1)/(2)))


def r1(sa):
    return 0.053627-0.512079*sa-0.038226*sa**(2)


def r2(sa):
    return 0.095248-0.891175*sa-0.24442*sa**(2)


def cos_theta(fcc,fl2,fl3):
    # abs(fcc) > abs(fl2) > abs(fl3)
    return ((fcc+fl2-2*fl3)/((2)**0.5*((fcc-fl2)**(2)+(fl2-fl3)**(2)+(fl3-fcc)**(2))**0.5))


def r(costhet,r11,r22):
    return ((2*r22*(r22**(2)-r11**(2))*costhet+r22*(2*r11-r22)*(4*(r22**(2)-r11**(2))*costhet**(2)+5*r11**(2)-4*r11*r22)**0.5)/(4*(r22**(2)-r11**(2))*costhet**(2)+(r22-2*r11)**(2)))


def falla(fcc,fl2,fl3, fc0):
    # abs(fcc) > abs(fl2) > abs(fl3)
    # fcu     = (4.435*ksi)
    fcu     = fc0
    costhet = cos_theta(-fcc,-fl2,-fl3)
    sa      = sigma_a(fcc*(fc0/fcu),fl2*(fc0/fcu),fl3*(fc0/fcu))
    r11     = r1(sa)
    r22     = r2(sa)
    return r(costhet,r11,r22)-tau_a(fcc,fl2,fl3)*(fc0/fcu)


# Solve equation to find fcc
def solve_equation(fl2,fl3, fc0):
    # Se fijan valores y se calculan los coeficientes.
    fl2_fix = -fl2 / fc0
    fl3_fix = -fl3 / fc0
    fc0_fix = fc0

    # Se crea ecuacion con solo una variable.
    fixed_equation = lambda fcc: falla(fcc,fl2_fix,fl3_fix, fc0_fix)
    
    # Provide an initial guess
    initial_guess = -1.0
    
    # Solve the equation using fsolve
    fcc_sol = -fsolve(fixed_equation, initial_guess)[0]

    return fcc_sol


# Function to obtain the data for the Mander 1988 abaco.
def data_abaco(aux_CalculateData=False):
    """Calculate data for the abaco Mander 1988

    Args:
        aux_CalculateData (bool, optional): Boolean variable to control whether the data of the plot is calculated. Defaults to False.

    Returns:
        dict: Dictionary with the data associated with the different plot curves.
    """
    # DATA ABACO
    if aux_CalculateData:
        fc0_aux = 1*1000
        Data_Abaco = {}
        # Recorre diferentes curvas a crear. 
        # Cada una de estas curvas tiene un set de valores asociados para graficar.
        # La data se almacena en un diccionario: Data_Abaco_dict = {}
        # Las keys del diccionario son nombres con la estructura "Datos_fl1_fc0_{i:.2f}"
        # Los datos asociados a cada keys, son dos listas con coordenadas: [[fcc/fc0, ...], [fl2/fc0, ...]]
