            key = f"Datos_fl1_fc0_{i:.2f}"
            Data_Abaco[key] = [[], []]
            fl3 = i * fc0_aux
            
            # Para trazar cada curva usa 100 puntos o menos.
            for j in np.arange(i, 0.305, 0.005):
                fl2 = j * fc0_aux
                coef_largest  = j
                coef_smallest = i
                coef_fcc      = solve_equation(fl2,fl3, fc0_aux)
                
