# Function to calculate the data for the interested value in the Mander 1988 abaco
def data_interested(fc0, fl3, fl2, aux_graph=False):
    """Function to calculate the data for the interested value in the Mander 1988 abaco

    Args:
        aux_graph (boolean): Boolean variable to control whether to plot the values for a value of interest.
        fc0 (float): Concrete compressive strength. [abs(fc0) > abs(fl2) > abs(fl3)]
        fl3 (float): Confined strength. [abs(fc0) > abs(fl2) > abs(fl3)]
        fl2 (float): Confined strength. [abs(fc0) > abs(fl2) > abs(fl3]

    Returns:
        dict: Data for the interested value in the Mander 1988 abaco
    """
    if aux_graph:
        #abs(fcc) > abs(fl2) > abs(fl3)
        if abs(fl2) < abs(fl3):
            print('fl2 = ', fl2)
            print('fl3 = ', fl3)
            print("Error en esfuerzos, verificar: fl2 > fl3")
            return
        
        coef_smallest = fl3 / fc0
        Data_interes = {}
        key = f"Datos_fl1_fc0_{coef_smallest:.2f}"
        Data_interes[key] = [[], []]
        
        for k in np.arange(coef_smallest, 0.305, 0.0002):
            fl2_aux = k * fc0
            coef_largest  = k
            coef_fcc      = solve_equation(fl2_aux,fl3, fc0)
            
            Data_interes[key][0].append(coef_fcc)
            Data_interes[key][1].append(coef_largest)
            
        return Data_interes
    
    else:
        return
    

# Main function to create Mander's abaco
def abaco_mander(fc0, fl3, fl2, URL, aux_graph=False, aux_CalculateData=False):
    """Function create the Mander(1988)'s abaco for the failure surface of confined concrete,
    proposed by William and Warnke (1975) using the triaxial tests of Schickert and Winkler (1977).
    For the representation, is determined the confined strength ratio fcc'/fco' for different values of
    fl3/fco' and fl2/fco'.

    Args:
        fc0 (float): Concrete compressive strength. [abs(fc0) > abs(fl2) > abs(fl3)]
        fl3 (float): Confined strength. [abs(fc0) > abs(fl2) > abs(fl3)]
        fl2 (float): Confined strength. [abs(fc0) > abs(fl2) > abs(fl3)]
        URL (str): Url to save the plot.
        aux_graph (boolean, optional): Boolean variable to control whether to plot the values for a value of interest. Defaults to False.
        aux_CalculateData (boolean, optional): Boolean variable to control whether the data of the plot is calculated. Defaults to False.
    """
    # Constants of interest
    coef_smallest = fl3 / fc0
    
    # DATA ABACO
    Data_Abaco = data_abaco(aux_CalculateData=aux_CalculateData)
    
    # DATA VALOR INTERES
    if aux_graph:
        Data_interes = data_interested(fc0, fl3, fl2, aux_graph=aux_graph)

    # GRAFICA BASE
    plt.rcParams['font.family'] = 'Century Gothic'
    font = FontProperties(style='italic')
                                    # Def. dimensiones de Layout para anima/graph.
    factor_reduccion = 0.455
    dim_x_fig = 7.5748 * factor_reduccion                                           # [in]
    dim_y_fig = 5.7913 * factor_reduccion                                           # [in]
    dpi       = 250                                                                 # 100 px/in^2
    fig       = plt.figure(figsize=(dim_x_fig, dim_y_fig), dpi = dpi)               # Crea fig y se impone dpi.
                                    # Axes son cuadros donde se grafica. (Layout.xlsm) 
    c_x1      = 0.1336
    c_y1      = 0.155
    w_f1      = 0.8332
    h_f1      = 0.7138
                                        # Def subplot como objetos Axes independiente.
    ax1       = fig.add_axes([c_x1, c_y1, w_f1, h_f1])
    
    # Extract of code from S01_GUI03_A01_ChartMander1988.py. Create the base for the Mander 1988 chart.
    exec(open('C_GUI03_ChartMander1988/S01_GUI03_A03_BaseGraph.py', encoding='utf8').read())
    
    # GRAFICA VALORES DE INTERES
                                                     # Grafica de datos de interes.
    if aux_graph:
        exec(open('C_GUI03_ChartMander1988/S01_GUI03_A04_InterestedGraph.py', encoding='utf8').read())
        return
                                                  # Solo grafica los datos de base.
    else:
                                                         # Specify the tick values.
        plt.xticks([1.0, 1.5, 2.0])
        plt.yticks([0, 0.1, 0.2, 0.3])
                                             # Set the tick labels to italic style.
        ax = plt.gca()
        for tick in ax.get_xticklabels() + ax.get_yticklabels():
            tick.set_fontproperties(font)
            tick.set_fontsize(15 * factor_reduccion)
        plt.savefig(URL)
        return
    


