                                                                   # Grafica de curvas.
        for i in np.arange(0, 0.32, 0.02):
            key = f"Datos_fl1_fc0_{i:.2f}"
            plt.plot(Data_Abaco[key][0], Data_Abaco[key][1], color = 'b')
                                                          # Grafica de curva fl1 = fl2.
        key = "Datos_fl1_fl2"
        plt.plot(Data_Abaco[key][0], Data_Abaco[key][1], color = 'b')
